import React from "react";

function ExpenseStatistic(props) {

    
  return (
    <div 
      style={{
        display: "flex",
        margin: "15px",
        marginBottom: 5,
        backgroundColor: "#f7dbfa",
        width: "95%",
        height: 180,
        borderRadius: 15,
        alignItems: "center",
      }}
    >
      <div className={props.isMonth ? 'slideBar' : ''}
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: 'relative'
          
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Jan
        </b>
      </div>
