        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: 'relative'
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Dec
        </b>
      </div>
    </div>
  );
}

export default ExpenseStatistic;
